function Home() {
  return (
    <div>
      <div id="homeBlock">
        <div id="homeContent">
          <div id="homeContentCenter">
            <h1>Art is Eternal Happiness</h1>
            <button className = 'btn'>Work With Us</button>
          </div>
        </div>
        <div id="homeContentDown">
          <button>Scrool Down</button>
        </div>
      </div>
    </div>
  );
}

export default Home;
